import React from "react";
import "./Navbar.css";
function Navbar() {
  return (
    <nav className="navBar">
      <section className="navBar__logo">
        <img
          src="https://i.pinimg.com/736x/f6/d0/af/f6d0af482a5a1116dbbd2fd3ff95e58c.jpg"
          alt="error"
        />
      </section>
    </nav>
  );
}

export default Navbar;
